  false,\n\t\"url\": null,\n\t\"notes\": \"We used data from 1984 samples taken approximately
  monthly over 11 yrs (1982 to 1992) with a drop trap sampler that sampled an area
  of 2.6 m2 to quantify and compare nekton densities along Spartina alterniflora marsh-edge
  and adjacent shallow nonvegetated bottom in Carancahua Cove, Galveston Bay estuary,
  Texas, USA. We also used a Geographic Information System (GIS), aerial photography,
  and population models to track changes in wetland area and trends in fishery populations
  over time.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
